starch or amylum is a polymericcarbohydrate consisting of numerous glucose units joined by glycosidic bonds. this polysaccharide is produced by most green plants for energy storage. worldwide, it is the most common carbohydrate in human diets, and is contained in large amounts in staple foods such as wheat, potatoes, maize (corn), rice,  and cassava (manioc).
in addition to starch synthesis in plants, starch can be synthesized from non-food starch mediated by an enzyme cocktail.&#91;27&#93; in this cell-free biosystem, beta-1,4-glycosidic bond-linked cellulose is partially hydrolyzed to cellobiose. cellobiose phosphorylase cleaves to glucose 1-phosphate and glucose; the other enzyme—potato alpha-glucan phosphorylase can add a glucose unit from glucose 1-phosphorylase to the non-reducing ends of starch. in it, phosphate is internally recycled. the other product, glucose, can be assimilated by a yeast. this cell-free bioprocessing does not need any costly chemical and energy input, can be conducted in aqueous solution, and does not have sugar losses.&#91;28&#93;&#91;29&#93;&#91;30&#93;
accumulated starch within plants is stored in semi-crystalline granules. each plant species has a unique starch granular size:  rice starch is relatively small (about 2&#160;μm), potato starches have larger granules (up to 100&#160;μm) and wheat and tapioca all in-between.&#91;37&#93;  unlike other botanical sources of starch, wheat starch has a bimodal size distribution, with both smaller and larger granules ranging from 2 to 55&#160;μm.&#91;37&#93;
some cultivated plant varieties have pure amylopectin starch without amylose, known as waxy starches. the most used is waxy maize, others are glutinous rice and waxy potato starch. waxy starches undergo less retrogradation, resulting in a more stable paste. a maize cultivar with a relatively high proportion of amylose starch, amylomaize, is cultivated for the use of its gel strength and for use as a resistant starch (a starch that resists digestion) in food products.
starch can also be dissolved or undergo gelation in ionic liquids or metal chloride salt solutions. the thermal transition of starch is largely influenced by the ratio of ionic liquid/water. aqueous ionic liquid with a certain ionic liquid/water ratio leads to the most effective structural disorganisation of some starches at significantly reduced temperature (even at room temperature).&#91;41&#93;&#91;42&#93; this phenomenon is very different from the dissolution of cellulose, as the latter occurs most efficiently in pure ionic liquids and any water contained in the ionic liquids will hinder the dissolution significantly.&#91;43&#93; it is proposed that for starches with granule surface pores (e.g. millet, waxy maize, normal maize and wheat starches), the corrosion by the aqueous il follows an inside-out pattern and the destruction to the granules is fast and even, whereas for starches with a relatively smooth surface (e.g. high-amylose maize, potato, purple yam and pea starches), the corrosion can only start from the surface and thus the change caused the aqueous il is slow.&#91;44&#93; besides, starch, even high-amylose starch, can be fully dissolved by aqueous metal chloride salts (e.g. zncl2, cacl2, and mgcl2) at moderate temperature (≤50&#160;°c), and starch nanoparticles can form during this dissolution process.&#91;45&#93;&#91;46&#93;
starch is the most common carbohydrate in the human diet and is contained in many staple foods. the major sources of starch intake worldwide are the cereals (rice, wheat, and maize) and the root vegetables (potatoes and cassava).&#91;53&#93; many other starchy foods are grown, some only in specific climates, including acorns, arrowroot, arracacha, bananas, barley, breadfruit, buckwheat, canna, colocasia, katakuri, kudzu, malanga, millet, oats, oca, polynesian arrowroot, sago, sorghum, sweet potatoes, rye, taro, chestnuts, water chestnuts, arrowroot and yams, and many kinds of beans, such as favas, lentils, mung beans, peas, and chickpeas.
the starch industry extracts and refines starches from seeds, roots and tubers, by wet grinding, washing, sieving and drying. today, the main commercial refined starches are cornstarch, tapioca, arrowroot,&#91;64&#93; and wheat, rice, and potato starches. to a lesser extent, sources of refined starch are sweet potato, sago and mung bean. to this day, starch is extracted from more than 50 types of plants.
